// SPDX-License-Identifier: AGPL-3.0
pragma solidity  ^0.8.17;

import {ArrayUtils} from '../utils/ArrayUtils.sol';


contract ArrayTest {

    uint256[] public array ;
    uint256[] public array2 ;

    function length() public  view returns (uint256 c) {
        return array.length;
    }

    function addValue(uint value) public  {
         ArrayUtils.addValue(array,value);
    }

  function add(uint value) public  {
         array.push(value);
    }



    function binarySearch(uint key) public view returns (bool, uint)  {
       return ArrayUtils.binarySearch(array,key);
    }

    function firstIndexOf(uint key) public view returns (bool, uint)  {
       return ArrayUtils.firstIndexOf(array,key);
    }


    function removeByIndex(uint index) public  {
        ArrayUtils.removeByIndex(array,index);
    }

    function removeByValue(uint256 value) public  {
        ArrayUtils.removeByValue(array,value);
    }

    function sort(uint256[] memory _array) public pure returns(uint256[] memory){
       return  ArrayUtils.sort(_array);
    }

    function reverse(uint256[] memory _array) public pure returns(uint256[] memory){
       return  ArrayUtils.reverse(_array);
    }

    function max() public view  returns (uint256 maxValue, uint256 maxIndex){
        return   ArrayUtils.max(array);
    }

    function min() public view  returns (uint256 minValue, uint256 minIndex){
        return  ArrayUtils.min(array);
    }

    function distinct() public  returns(uint256){
       return  ArrayUtils.distinct(array);
    }


}
